query:
fragment PageInfoFragment on PageInfo {
  endCursor
  hasNextPage
  hasPreviousPage
  startCursor
  __typename
}

fragment VoucherTranslationFragment on Voucher {
  id
  name
  translation(languageCode: $language) {
    id
    language {
      code
      language
      __typename
    }
    name
    __typename
  }
  __typename
}

query VoucherTranslations($language: LanguageCodeEnum!, $first: Int, $after: String, $last: Int, $before: String, $filter: VoucherFilterInput) {
  vouchers(before: $before, after: $after, first: $first, last: $last, filter: $filter) {
    edges {
      node {
        ...VoucherTranslationFragment
        __typename
      }
      __typename
    }
    pageInfo {
      ...PageInfoFragment
      __typename
    }
    __typename
  }
}
